var common=require("../common"),test=require("utest"),assert=common.assert,File=common.require("file"),file,now=new Date;test("IncomingForm",{before:function(){file=new File({size:1024,path:"/tmp/cat.png",name:"cat.png",type:"image/png",lastModifiedDate:now,filename:"cat.png",mime:"image/png"})},"#toJSON()":function(){var e=file.toJSON(),t=Object.keys(e).length;assert.equal(1024,e.size);assert.equal("/tmp/cat.png",e.path);assert.equal("cat.png",e.name);assert.equal("image/png",e.type);assert.equal("image/png",e.mime);assert.equal("cat.png",e.filename);assert.equal(now,e.mtime);assert.equal(t,8)}});